(async()=>{console.log("Render is starting"),console.log(window.globalLibraries);var e=window.globalLibraries.yamlLoad,t=document.getElementById("canvas");t.innerHTML="";var a=document.createElement("header");a.classList.add("header");var i=document.createElement("div");i.classList.add("header-content"),i.setAttribute("id","header-title"),a.appendChild(i),t.appendChild(a);var d=document.createElement("main");d.classList.add("main"),t.appendChild(d);var l=document.createElement("section");l.classList.add("main-left"),d.appendChild(l);var n=document.createElement("section");n.classList.add("main-body"),n.setAttribute("id","main-body"),l.appendChild(n);var s=document.createElement("section");s.classList.add("main-right"),s.setAttribute("id","main-right"),d.appendChild(s);var r=document.createElement("div");r.classList.add("layer-right"),r.setAttribute("id","layer-right"),s.appendChild(r);const c=document.getElementById("yamlTextArea").value,o=await e(c);console.log("data",o);const m=Object.keys(o.layers),y=o.layers[m[m.length-1]];document.getElementById("header-title").innerHTML=o.users.title;const v=document.getElementById("main-body");let h="";for await(const e of m){const t=o.layers[e];if(t.title===y.title||0===m.length)break;h+=`<div class='layer'><div class="layer-title">${t.title} </div><div class="layer-body"> replaceItems </div></div>`;let a="";for await(const e of t.items)a+=`<div class="layer-body-item">${e}</div>`;h=h.replace("replaceItems",a)}v.innerHTML=h;const g=document.getElementById("layer-right");let p="";p=`<div class="layer-right-title">${y.title}</div><div class="layer-body-right">replaceItems</div>`;let u="";for(const e of y.items)u+=`<div class="layer-body-item">${e}</div>`;p=p.replace("replaceItems",u),g.innerHTML=p})();